 jako majitel&eacute;, či u odchovů jako chovatel&eacute;, je nutn&eacute; se zde registrovat a pot&eacute; zaslat na mail: </span></strong><a href=\"mailto:genealogie.corgi.kelpie@seznam.cz\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">genealogie.corgi.kelpie@seznam.cz</span></strong></a><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\"> o kter&eacute; jedince se jedn&aacute;. U dlouhodob&yacute;ch chovatelů to nebude nutn&eacute;, ale u těch nověj&scaron;&iacute;ch zas&iacute;lejte jako potvrzen&iacute; o vlastnictv&iacute; psa kopii PP. Bez registrace a n&aacute;sledn&eacute;ho přiřazen&iacute; v&aacute;s, jako majitele, nemůžete karty va&scaron;ich psů editovat.</span></strong></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">Pokud byste přece jen v&nbsp;datab&aacute;zi nena&scaron;li sv&eacute;ho psa, či zahraničn&iacute;ho psa-otce sv&yacute;ch &scaron;těň&aacute;tek, můžete jej po přihl&aacute;&scaron;en&iacute; na sv&eacute;m profilu do datab&aacute;ze přidat. N&aacute;sledně bude spr&aacute;vcem schv&aacute;len a v&nbsp;datab&aacute;zi zobrazen.</span></strong></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">Datab&aacute;ze je průběžně doplňov&aacute;na. Ke každ&eacute;mu zv&iacute;řeti se daj&iacute; vkl&aacute;dat fotky (až 5 fotek ke každ&eacute;mu jedinci), přid&aacute;vat informace o splněn&yacute;ch zkou&scaron;k&aacute;ch, zdravotn&iacute;ch vy&scaron;etřen&iacute;ch, z&iacute;skan&yacute;ch titulech, potomc&iacute;ch, sourozenc&iacute;ch a třeba i pov&iacute;d&aacute;n&iacute; o va&scaron;em pejskovi. V&iacute;ce informac&iacute; naleznete v&nbsp;z&aacute;ložce <strong style=\"mso-bidi-font-weight: normal;\">Jak přidat data.</strong></span></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\"><!-- [if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--></span></strong></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\"><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:HyphenationZone>21</w:HyphenationZone>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>CS</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMa