(38,	20,	'en',	'<p>Home</p>\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif; font-size: 14px;\">&nbsp;</p>\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif; font-size: 14px;\">&nbsp;</p>'),
(39,	21,	'cs',	'<p>Zde se můžete přihl&aacute;sit do syst&eacute;mu.</p>'),
(40,	21,	'en',	'<p>Here you can login to system.</p>'),
(41,	22,	'cs',	'<p>Registrace nov&eacute;ho uživatele</p>\n<p>V&aacute;žen&iacute; chovatel&eacute;,</p>\n<p>ž&aacute;d&aacute;me V&aacute;s o co nejpřesněj&scaron;&iacute; Va&scaron;ich identifikačn&iacute;ch &uacute;dajů. Tyto &uacute;daje budou použity pouze pro potřeby poradců chovu.&nbsp;</p>\n<p>Garantujeme V&aacute;m, že je neposkytneme třet&iacute; straně ani je nezneužijeme ke komerčn&iacute;m &uacute;čelům.</p>\n<p>&nbsp;</p>\n<p>&Uacute;daje, kter&eacute; chcete zveřejnit na na&scaron;ich str&aacute;nk&aacute;ch, pros&iacute;m vyberte v položce \"Sd&iacute;len&iacute; informac&iacute;:\".</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Pros&iacute;me, nevkl&aacute;dejte duplicitn&iacute; registrace! Nejdř&iacute;ve si zkontrolujte, zda se v datab&aacute;zi nach&aacute;z&iacute;te jako chovatel nebo majitel někter&eacute;ho ze psů.&nbsp;</p>\n<p>Pokud ano, již jste registrovan&iacute; a heslo přidělen&eacute; syst&eacute;mem si vyž&aacute;dejte u spr&aacute;vce datab&aacute;ze. Děkujeme</p>'),
(42,	22,	'en',	'<p>Registration of new user</p>\n<p>Dear breeders,</p>\n<p>we would like to appeal to you for accurate your identification description. These records will be used only for breeding adviser.&nbsp;</p>\n<p>We guarantee to you, that we never give these information to third side and we never use them for commercial purpose.</p>\n<p>&nbsp;</p>\n<p>Records, which you want to public on our website, please choose in information item \"Sharing information:\".</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Please, do not insert duplicated registration. Please, first control, if you are in database as a breeder or owner of some dog.&nbsp;</p>\n<p>If yes, you are registered yet and for password given by system ask atAdministrator of database. Thank you</p>'),
