mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Proč se registrovat?</span></strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\"><br /> Vyplněn&iacute;m registrace umožn&iacute;te ostatn&iacute;m n&aacute;v&scaron;těvn&iacute;kům sd&iacute;let va&scaron;e kontaktn&iacute; informace (dle v&yacute;běru, buď v&scaron;e, nebo jen č&aacute;st kontaktn&iacute;ch informac&iacute;). Z&aacute;roveň se můžete zařadit na maillist a pokud budeme m&iacute;t nějak&eacute; novinky, budeme V&aacute;s emailem o nich informovat. Kromě toho jsou registrovan&yacute;m uživatelům př&iacute;stupn&eacute; dal&scaron;&iacute; funkce jako např&iacute;klad el. kryc&iacute; list, vkl&aacute;d&aacute;n&iacute; vrhů apod.&nbsp;<strong>Pros&iacute;me, než se začnete registrovat, zkontrolujte si, zda se již v datab&aacute;zi nenach&aacute;z&iacute;te jako majitel nebo chovatel někter&eacute;ho ze psů. V takov&eacute;m př&iacute;padě si v sekci přihl&aacute;&scaron;en&iacute; můžete nechat zaslat obratem heslo, kter&eacute; V&aacute;m syst&eacute;m přidělil a kter&eacute; si n&aacute;sledně můžete ihned změnit. Zabr&aacute;n&iacute;te t&iacute;m duplicitn&iacute; registraci.</strong>&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; background: white;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Jak doplnit informace?<br /> </span></strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Informace o psech doplňuj&iacute; registrovan&iacute; uživatel&eacute; ke sv&yacute;m psům ve sv&eacute;m profilu (z&aacute;ložka Moji psi) pomoc&iacute; změnov&eacute;ho formul&aacute;ře, kter&yacute; je pro přehlednost a jednoduchost vytvořen jako karta psa, kde můžete doplnit nov&eacute; &uacute;daje a ve spodn&iacute; č&aacute;sti přiložit potřebn&eacute; podklady (daj&iacute; se přikl&aacute;dat i jednotliv&eacute; naskenovan&eacute; formul&aacute;ře o zdravotn&iacute;ch vy&scaron;etřen&iacute;ch, zkou&scaron;k&aacute;ch, v&yacute;stavn&iacute;ch titulech, d&aacute;le tak&eacute; fotky &ndash; fotka, kterou vlož&iacute;te jako prvn&iacute;, bude použita jako fotka hlavn&iacute; (zobraz&iacute; se na kartě nahoře) a maxim&aacute;lně dal&scaron;&iacute; 4 fotky na spodek karty psa. Fotky by měly b&yacute;t ostr&eacute;, dobr&eacute; kvality, z důvodů přenosu dat je zas&iacute;lejte ve form&aacute;tu&nbsp;<strong>JPG</strong>&nbsp;upravte na&nbsp;<strong>maxim&aacute;ln&iacute; v&yacute;&scaron;ku 400 px</strong>&nbsp;a pojmenujte rodokmenov&yacute;m jm&eacute;nem psa (např. be_my_lord_nelson_of_flying_heartbreakers.jpg). Pokud za&scaron;lete v&scaron;ech 5 fotek, doporučujeme, aby byl na jedn&eacute; pes vyfocen v postoji, na druh&eacute; byla studie hlavy a dal&scaron;&iacute; tři fotky již dle va&scaron;eho uv&aacute;žen&iacute;.</span></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Po odesl&aacute;n&iacute; dojde upozorněn&iacute; administr&aacute;torovi, kter&yacute; dan&eacute; změny schvaluje. Administr&aacute;tor zkontroluje pravdivost uveden&yacute;ch &uacute;dajů na z&aacute;kladě zaslan&yacute;ch př&iacute;loh, a pokud je v&scaron;e v poř&aacute;dku doloženo, změny schv&aacute;l&iacute; a prop&iacute;&scaron;ou se do datab&aacute;ze. Aktualizace proběhne do 48hodin od odesl&aacute;n&iacute; změn (v&yacute;jimečně může trvat d&eacute;le).</span></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Po přihl&aacute;&scaron;en&iacute; tedy můžete upravit zcela samostatně svůj profil, můžete upravit va&scaron;i adresu, webov&eacute; str&aacute;nky, email, telefon a změnit i m&iacute;ru sd&iacute;len&iacute; těchto informac&iacute; a d&aacute;le doplnit informace ke sv&yacute;m psům a odeslat je ke schv&aacute;len&iacute; včetně potřebn&yacute;ch podkladů.</span></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; background: white;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Pokud v datab&aacute;zi nenaleznete sv&eacute;ho psa nebo pokud jej najdete bez uveden&iacute; v&aacute;s jako majitele, kontaktujte n&aacute;s na <em><u>genealogie.corgi.kelpie@seznam.cz</u></em><br /> Jako doklad o vlastnictv&iacute; psa slouž&iacute; kopie rodokmenu!</span></strong></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; background: white;\"><span style=\"font-size: 8.0pt; font-family: \'Tahoma\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; background: white;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-fareast-language: CS;\">Co v&scaron;e datab&aacute;ze obsahuje?</span></strong></p>\n<ul type=\"disc\">\n<li class=\"MsoNormal\" style=\"color: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><u><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">Informace k jedinci v tomto rozsahu:</span></u><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\"> tituly před jm&eacute;nem, jm&eacute;no, plemeno, zbarven&iacute;, pohlav&iacute;, datum narozen&iacute;, datum &uacute;mrt&iacute;, kohoutkovou v&yacute;&scaron;ku, č&iacute;slo z&aacute;pisu, dal&scaron;&iacute; č&iacute;slo z&aacute;pisu (např. v př&iacute;padě importovan&yacute;ch nebo exportovan&yacute;ch jedinců), č&iacute;slo tetov&aacute;n&iacute;, č&iacute;slo čipu, informace o bonitaci a chovnosti, informace o zdrav&iacute; i s možnost&iacute; evidovat datum vy&scaron;etřen&iacute; a veterin&aacute;ře, kter&yacute; jej provedl (DKK, DLK, PRA, DOV, DM, SA, vWD, MDR1, DNA profil a dal&scaron;&iacute; doplňkov&eacute; informace o zdrav&iacute;), informace o varlatech, skusu a zubech, chovatele, majitele, tituly, bonitačn&iacute; posudek, oceněn&iacute;, zkou&scaron;ky a z&aacute;vody, pozn&aacute;mky, a samozřejmě rodokmen jedince s voliteln&yacute;m počtem generac&iacute; od 3 do 7 a s v&yacute;počtem př&iacute;buznosti (Wrightův vzorec - v&yacute;počet 5-ti generac&iacute;, pokud jsou vyplněny). Informace o kontrole vrhu, sourozenc&iacute;ch a potomc&iacute;ch. V&scaron;echny položky se nemus&iacute; zobrazovat, pokud nejsou vyplněn&eacute;. </span></li>\n<li class=\"MsoNormal\" style=\"color: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; mso-list: l0 level1 lfo1; ta