und: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">Funkci \"zobrazit posledn&iacute;ch 14 dnů\" - ocen&iacute; zejm&eacute;na ti, co budou nav&scaron;těvovat datab&aacute;zi častěji. Při každ&eacute; změně informac&iacute; se totiž ulož&iacute; datum posledn&iacute; editace, takže pokud zvol&iacute;te tuto funkci, zobraz&iacute; se pouze jedinci, u kter&yacute;ch byly &uacute;daje během 14 dnů pozměněny. V&yacute;sledek je pak řazen podle data editace, od nejaktu&aacute;lněj&scaron;&iacute;ch z&aacute;znamů po nejstar&scaron;&iacute;.</span></li>\n<li class=\"MsoNormal\" style=\"color: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">Pokud vyhled&aacute;te jedince přes filtr a přejdete do editace, pak &scaron;ipkou zpět nebo kliknut&iacute;m na z&aacute;ložku genealogie se dostanete opět ke sv&eacute;mu v&yacute;běru. Když budete cht&iacute;t zobrazit znovu hlavn&iacute; str&aacute;nku genealogie, překlikněte nejdř&iacute;ve na jinou z&aacute;ložku menu a pot&eacute; se vraťte na genealogii.</span></li>\n<li class=\"MsoNormal\" style=\"color: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">V seznamu chovatelsk&yacute;ch stanic se va&scaron;e objev&iacute; ve chv&iacute;li, kdy u sv&eacute; registrace povol&iacute;te sd&iacute;len&iacute; n&aacute;zvu chovatelsk&eacute; stanice. Takt&eacute;ž, chcete-li b&yacute;t u va&scaron;eho psa uvedeni jako majitel&eacute; včetně kontaktů, povolte sd&iacute;len&iacute; dan&yacute;ch informac&iacute;. Tel. č&iacute;slo zad&aacute;vat nemus&iacute;te, nen&iacute; povinn&eacute;.</span></li>\n<li class=\"MsoNormal\" style=\"color: black; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: CS;\">Položka &bdquo;&scaron;těňata&ldquo; v&nbsp;menu, slouž&iacute; k&nbsp;zad&aacute;v&aacute;n&iacute; informac&iacute; o narozen&yacute;ch &scaron;těňatech, tedy v&nbsp;podstatě stručn&aacute; inzerce. </span></li>\n</ul>'),
(44,	23,	'en',	'<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">Why sign up ?</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">By completing the registration to allow other visitors to share your contact information ( your choice, either all or only part of the contact information). At the same time , you can include the mailing list , and if we have any news , we will email you about them. In addition, registered users access to additional features such as el.kryc&iacute; list , inserting litters , etc.</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">Please register before you begin , make sure you are already in the database do not find any such owner or keeper of any dog . In this case, the login section , you can receive immediately the password that you assigned to a system which then can immediately change . To prevent duplicate registration.</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">How to add information ?</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">Information about dogs registered users complement to your dogs in your profile ( My tab psi) using the change form that is simple and well designed as the dog card where you can add new information and at the bottom to attach the necessary documents ( attachments can be scanned and individual form of medical screening tests , show titles , as well as photos - photos that you put first will be used as the main picture (shown top right cards) and a maximum of 4 additional photos at the bottom card of the dog. photos should be sharp , good quality of reasons, the data transfer should be sent in JPG format , adjust the maximum height of 400 px and name rodokmenov&yacute;m dog\'s name (eg be_my_lord_nelson_of_flying_heartbreakers.jpg ) . If you do all 5 photos , please bring it to a dog photographed in position to another was studies of the head and the other three photos may already be your choice. ) .</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">After sending the administrator will notice that the changes are approved . The administrator checks the veracity of these data on the basis of the attachments and if all is well documented , and transcriptions approve changes to the database . Updates take place within 48 hours of sending changes ( in exceptional cases may take longer) .</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">After logging in , so you can edit your profile completely separately , you can modify your address , website , email, phone and also change the level of sharing that information and add information to their dogs and send them for approval , including the necessary documents .</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">If the database can not find your dog or if you can find it without putting you as the owner , please contact us collie@email.cz</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">As proof of ownership of the dog used copy of the family tree !</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">What all database contain?</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; Record information to individuals in this range: title before a name , the name , breed, color , sex , date of birth , date of death , cause of death , registration number , registration number of the other (eg in the case of imported or exported animals), tattoo number , number Chip type of breeding (currently breeding in the Czech Republic x others) , commentary on breeding , wide health information with the possibility to record the date of examination and the vet who performed it ( HD, ED , hereditary eye defects , DNA CEA / CH DNA MDR1 , another additional health information ), information about the testicles , bite and teeth , the teeth comment , breeder , owner , previous owner , titles , breeding advice, awards , tests and competitions , comment , and of course the individual pedigree with optional number of generations 3 to 7 with the calculation of relatedness ( Wright formula - calculation 5 generations when filled ) . All items may not be displayed if they are not completed .</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; search for dogs by name:</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; \"starts\" - will find all of the individual beginning with the letters entered</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; \"contains\" - will find all of the individual containing the specified word (s) in its name</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; eg : if you select the offer with the name \"starts\" and type in box A, show you all dogs beginning with the letter A. If you select \"contains\" and type as \" Grenay \" will show you all of the dogs who are in the name of included Grenay - the dogs from the kennel .</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; You can narrow your selection further by the following items :</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; breed (DK , KK, Sheltie )</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; color</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; gender - choose only dogs or bitches</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; year of birth</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; breeding - display only the individual currently breeding in the Czech Republic</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; value of DKK</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; ED values</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; + -2cm height</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; region</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; breeder</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; test</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; icon with the head of a dog in front of the name means that the individual is inserted at least one photo</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; the \" show last 14 days \" - especially appreciated by those who will attend the database more frequently. Whenever you change information is stored date of the last edit , so if you choose this option , only individuals for whom data were altered within 14 days . The result is then ranked according to data editing, records from the most recent to the oldest.</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; \" full \" - recordings can also use full-text search , for example searching for an individual with a test title, but even with certain health problems , or search for individual dogs breeders or owners.</span></span></p>\n<p class=\"MsoNormal\" style=\"font-family: Tahoma, Verdana, Arial, Helvetica; font-size: 10.6667px; text-align: justify; line-height: normal;\"><span style=\"font-family: Tahoma, Verdana, Arial, Helvetica;\"><span style=\"font-size: 10.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; In the field \"search \" , type any word and if found in some individuals , and these individuals will be displayed . If you want to find a word that inflects certain way , your only its base . For example, enter the word club , the system searches for all words containing \" club \" : club , club , club , etc. but also turn out to be . If you type OB , find all individuals by an examination Commercial Code , TP1 , TP2 , TP3 ...&nbsp;</span></span></p>'),
(45,	24,	'cs',	'<p><span style=\"font-family: tahoma, arial, verdana; font-size: 10.6667px;\">Pokud jste v seznamu nena&scaron;li Va&scaron;&iacute; fenu nebo psa, kontaktujte n&aacute;s pros&iacute;m, datab&aacute;zi dopln&iacute;me!</span></p>'),
